import React from 'react';
import './about.css';
import { Routes, Route } from 'react-router-dom'

import Partners from '../Partners/partners';

const styles = {
    background: {
        background: 'green'
    }
}

export default function About() {
    return (
        <div>
            <div class="topImg">

            </div>
            <div>
            <Routes>
                <Route path='/partners' element={<Partners />} />
            </Routes>
            </div>


            <div class="bottomImg">
                <div>

                </div>
                <div class="container" style={styles.background}>

                    <h2>Who we are.</h2>
                </div>


            </div>
        </div>

    )
}
